import { Tile } from './models/tile';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';



@NgModule({
  imports: [
    BrowserModule,
    ReactiveFormsModule,
    BrowserAnimationsModule
  ],
  exports: [
    MatButtonModule,
  ],  
  providers: [
    GridMatrix,
    Tile
  ],
  declarations: [
    AppComponent,
    Bonfire10Component,
    DungeonComponent,
  ],
  bootstrap: [ AppComponent ]
})
